import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import ObjectPage from "./components/ObjectPage";
import SubjectPage from "./components/SubjectPage";

function App() {
  return (
    <div>
      <Header />
      <main>
        <ObjectPage />
        <SubjectPage />
      </main>
      <Footer />
    </div>
  );
}

export default App;
